import React from 'react';
import { Fab, FormControlLabel, Grid, Slider, Switch, Typography } from '@material-ui/core';

function AlgoControls() {
    return(
        <>
            <Typography variant="h6" style={{margin:"10px"}}>Algorithm Controls</Typography>

            <div id="SolvingSpeedControl" style={{margin:"10px"}}>
                <Typography variant="body1">Solving Speed</Typography>
                <Grid container spacing={2}>
                    <Grid item>
                        <Typography variant="body1">10</Typography>
                    </Grid>
                    <Grid item xs>
                        <Slider value={50}/>
                    </Grid>
                    <Grid item>
                        <Typography variant="body1">1000</Typography>
                    </Grid>
                </Grid>
            </div>

            <FormControl className={classes.formControl}>
        <InputLabel htmlFor="age-native-simple">Age</InputLabel>
        <Select
          native
          value={state.age}
          onChange={handleChange}
          inputProps={{
            name: 'age',
            id: 'age-native-simple',
          }}
        >
          <option aria-label="None" value="" />
          <option value={10}>Ten</option>
          <option value={20}>Twenty</option>
          <option value={30}>Thirty</option>
        </Select>
      </FormControl>

            <Fab variant="extended" color="primary">Randomize</Fab>
        </>
    );
}

export default AlgoControls;
